import math
def calculate_angles(a,b,c):
    """
    Given three sides a, b, c, calculates the three angles
    A, B, C of the triangle. Each angle should be rounded
    up to the next integer (’ceil’).
    Returns a tuple (angleA, angleB, angleC).
    """
    if a>0 and b>0 and c>0:
        if ((a+b)>c) and ((b+c)>a) and ((c+a)>b):
            A = math.acos((b*b + c*c - a*a)/(2*b*c))
            B= math.acos((a*a + c*c - b*b)/(2*a*c))
            C = math.acos((b*b + a*a - c*c)/(2*b*a))
            angleA,angleB,angleC = math.degrees(A),math.degrees(B),math.degrees(C)
            return (round(angleA),round(angleB),round(angleC))
        else:
            return None
    else:
        print('Please Enter Natural Numbers')

