import math

def calculate_angles(a, b, c):
    """Calculates the angles of a triangle given its sides."""
    if a + b <= c or a + c <= b or b + c <= a:
        return None

    def angle(x, y, z):
        cos_val = (y**2 + z**2 - x**2) / (2 * y * z)
        angle_rad = math.acos(cos_val)
        return math.ceil(math.degrees(angle_rad))

    A = angle(a, b, c)
    B = angle(b, a, c)
    C = angle(c, a, b)
    return (A, B, C)
