from math import ceil,acos,degrees

def calculate_angles(a, b, c):
    """
    Given three sides a, b, c, calculates the three angles
    A, B, C of the triangle. Each angle should be rounded
    up to the next integer (’ceil’).
    Returns a tuple (angleA, angleB, angleC).
    """
    if a==b==c:
        return(60,60,60)
    elif a+b>c and b+c>a and c+a>b:
        A=ceil(degrees(acos((b**2+c**2-a**2)/(2*b*c))))
        B=ceil(degrees(acos((a**2+c**2-b**2)/(2*a*c))))
        C=ceil(degrees(acos((a**2+b**2-c**2)/(2*a*b))))
        return (A,B,C)
    else:
        return None

def is_disarium(num:int):
    num=str(num)
    dis=len(num)
    x=0
    for i in range(dis):
        dig=(int(num[i]))**(i+1)
        x=x+dig
    if x==int(num):
        return "is an disarium"
    else:
        return "is not an disarium"



