import math

def calculate_angles(a, b, c):
    if a + b <= c or b + c <= a or c + a <= b:
        return None
    else:
        cosA = (b ** 2 + c ** 2 - a ** 2) / (2 * b * c)
        cosB = (c ** 2 + a ** 2 - b ** 2) / (2 * a * c)
        cosC = (a ** 2 + b ** 2 - c ** 2) / (2 * a * b)
        if cosA > 1:
            cosA = 1
        elif cosA < -1:
            cosA = -1
        if cosB > 1:
            cosB = 1
        elif cosB < -1:
            cosB = -1
        if cosC > 1:
            cosC = 1
        elif cosC < -1:
            cosC = -1
        A = round(math.degrees(math.acos(cosA)))
        B = round(math.degrees(math.acos(cosB)))
        C = round(math.degrees(math.acos(cosC)))
        return (A, B, C)

