    if cosa > 1:
        cosa = 1
    if cosa < -1:
        cosa = -1

    if cosb > 1:
        cosb = 1
    if cosb < -1:
        cosb = -1

    if cosc > 1:
        cosc = 1
    if cosc < -1:
        cosc = -1


    angleA = round(math.degrees(math.acos(cosa)))
