print(f"The angles are : {result}")

import math


def cosine_law(a, b, c):
    radians = math.acos((b ** 2 + c ** 2 - a ** 2) / (2 * b * c))
    degrees = math.degrees(radians)

    return math.ceil(degrees)


def calculate_angles(a, b, c):
    """
    Given three sides a, b, c, calculates the three angles
    A, B, C of the triangle. Each angle should be rounded
    up to the next integer (`ceil`).
    Returns a tuple (angleA, angleB, angleC).
    """
    sides = sorted([a, b, c])

    if sides[0] + sides[1] <= sides[2]:
        return None

    return (cosine_law(a, b, c), cosine_law(b, c, a), cosine_law(c, a, b))

import math

def calculate_angles(a, b, c):
    if a + b > c and b + c > a and a + c > b:
        A = math.degrees(math.acos(((b**2 + c**2) - a**2) / (2 * b * c)))
        B = math.degrees(math.acos(((a**2 + c**2) - b**2) / (2 * a * c)))
        C = math.degrees(math.acos(((a**2 + b**2) - c**2) / (2 * a * b)))
        return (int(math.ceil(A)), int(math.ceil(B)), int(math.ceil(C)))
    else:
        return None

