def calculate_angles(a, b, c):
    # Check if valid triangle
    if a + b > c and b + c > a and a + c > b:
        ang = []
        # Cosine rule
        ang.append(round(math.degrees(math.acos((b**2 + c**2 - a**2) / (2 * b * c)))))  # angle A
        ang.append(round(math.degrees(math.acos((a**2 + c**2 - b**2) / (2 * a * c)))) ) # angle B
        ang.append(round(math.degrees(math.acos((a**2 + b**2 - c**2) / (2 * a * b)))))  # angle C
        return tuple(ang)
    else:
        return None

